import React from "react";

const BodyQE = () => {
    return (
        <div id="main">
            <div className="inner">
            
                <a href="" className="logo">
                 <span className="symbol"></span><span className="title">
                 <h1> Queen Elizabeth I</h1></span>
                  </a>
                <span className="image left"><img src="images/qechild.jpg" alt="" style= {{width:"250px", height:"40%"}} ></img></span>
                <p align="left">Queen Elizabeth I (September 7, 1533 to March 24, 1603) claimed the throne in 1558 at the age of 25 and held it until her death 44 years later. The daughter of King Henry VIII and his second wife Anne Boleyn, Elizabeth I was born a princess but declared illegitimate through political machinations. Eventually, upon her half-sister Mary Tudor’s death, she took the crown. During her reign, Elizabeth I established Protestantism in England; defeated the Spanish Armada in 1588; maintained peace inside her previously divided country; and created an environment where the arts flourished.</p>
                <p align="left">Queen Elizabeth I’s reign was sometimes referred to as the Golden Age or Elizabethan England, an era of peace and prosperity when the arts had a chance to blossom with Elizabeth's support. While she worked hard at court, Elizabeth took time for leisurely pursuits. She loved music and could play the lute. Thomas Tallis and William Byrd were among her court musicians. Elizabeth also enjoyed dancing and watching plays. Elizabeth's reign supported the creation of works by such greats as William Shakespeare and Christopher Marlowe.</p>
                <h2>“Though the sex to which I belong is considered weak you will nevertheless find me a rock that bends to no wind.”</h2>
                <p align="left">In 1558, Elizabeth took the reins of her country after her sister Queen Mary died and ruled until her death in 1603. Elizabeth I inherited a number of problems stirred up by Mary. The country was at war with France, which proved to be a tremendous drain on the royal coffers. There was also great tension between different religious factions after Mary worked to restore England to Roman Catholicism by any means necessary. In fact, she earned the nickname Bloody Mary for ordering the execution of 300 Protestants as heretics.</p>
                <p align="left">Elizabeth acted swiftly to address these two pressing issues. During her first session of Parliament in 1559, she called for the passage of the Act of Supremacy, which re-established the Church of England, and the Act of Uniformity, which created a common prayer book. Elizabeth took a moderate approach to the divisive religious conflict in her country. "There is one Jesus Christ," she once said. "The rest is a dispute over trifles." However, Catholics did suffer religious persecution and some were executed under her reign, though historians differ on the extent. The Roman Catholic Church took a dim view of her actions, and in 1570, Pope Pius V excommunicated Elizabeth.</p>
                <span className="image main"><img src="images/queen.jpg" alt="" /></span>
                <p align="left">With the assistance of her key advisor, William Cecil, Elizabeth ended the war with France. She was able to avoid clashing with the other superpower of the age, Spain, for much of her reign. Finally, in 1585, Elizabeth entered the fray to support the Protestant rebellion against Spain in the Netherlands. Spain then set its sights on England, but the English navy was able to defeat the infamous Spanish Armada in 1588. According to several reports, the weather proved to be a deciding factor in England's victory.</p>
                <p align="left">While the end of her reign had been difficult, Elizabeth has largely been remembered as being a queen who supported her people. Her lengthy time on the throne provided her subjects with stability and consistency, and her sharp wits and clever mind helped navigate the nation through religious and political challenges. </p>                
                 </div>
        </div>
    );
}

export default BodyQE;
